import React, { Fragment } from 'react';
import Main from './components/pages/Main';
import Navbar from './components/layout/Navbar';
import './App.css';

function App() {
  return (
    <div className="App">
      <Fragment>
        <Navbar />
        <Main />
      </Fragment>
    </div>
  );
}

export default App;
